const userDetails = ({ user }) => {
    if(!user) return
    return(
    <div className="user-details">
        <h1>{user.numVotes}</h1>
        <p><strong>Voted today: </strong>{user.voted.toString()}</p>

        <p>{user.currentColor}</p>
    </div>)
}

export default userDetails
